        var reste = time - now - o.decalage;
        if (reste < 0) {
            reste = 0;
        }
        var days = 0;
        var hours = 0;
        var minutes = 0;
        var seconds = 0;
        seconds = reste % 60;
        if (reste >= 60)
            minutes = Math.floor(reste / 60) % 60;
        if (reste >= 60 * 60)
            hours = Math.floor(reste / 60 / 60) % 24;
        if (reste >= 60 * 60 * 24)
            days = Math.floor(reste / 60 / 60 / 24);
